--
-- Create procedure `Proc_Updatemoduleclass`
--
CREATE PROCEDURE Proc_Updatemoduleclass (IN ModuleClassCode varchar(20), IN ModuleID char(36), IN SemesterID char(36), IN Status int, IN StartTime date, IN EndTime date, IN ModuleClassID char(36), IN SchoolYearID char(36), IN TeacherID char(36))
SQL SECURITY INVOKER
BEGIN
  UPDATE moduleclass m
  SET m.ModuleClassCode = ModuleClassCode,
      m.ModuleID = ModuleID,
      m.SemesterID = SemesterID,
      m.Status = Status,
      m.StartTime = StartTime,
      m.EndTime = EndTime,
      m.TeacherID = TeacherID,
      m.SchoolYearID = SchoolYearID,
      m.CreatedDate = NOW(),
      m.ModifiedDate = NOW()
  WHERE m.ModuleClassID = ModuleClassID;
END
$$

--
-- Create procedure `Proc_Insertmoduleclass`
--
CREATE PROCEDURE Proc_Insertmoduleclass (IN ModuleClassCode varchar(20), IN ModuleID char(36), IN SemesterID char(36), IN Status int, IN StartTime date, IN EndTime date, IN SchoolYearID char(36), IN TeacherID char(36), IN ModuleCode varchar(20))
SQL SECURITY INVOKER
BEGIN
  DECLARE ID char(36);
  IF ModuleCode IS NOT NULL THEN
    SET ID = (SELECT
        m.ModuleID
      FROM module m
      WHERE m.ModuleCode = ModuleCode);
    INSERT INTO moduleclass (ModuleClassID, ModuleClassCode, ModuleID, TeacherID, SemesterID, SchoolYearID, Status, StartTime, EndTime, CreatedDate, ModifiedDate)
      VALUES (UUID(), ModuleClassCode, ID, TeacherID, SemesterID, SchoolYearID, Status, StartTime, EndTime, NOW(), NOW());
  ELSEIF ModuleCode IS NULL THEN
    INSERT INTO moduleclass (ModuleClassID, ModuleClassCode, ModuleID, TeacherID, SemesterID, SchoolYearID, Status, StartTime, EndTime, CreatedDate, ModifiedDate)
      VALUES (UUID(), ModuleClassCode, ModuleID, TeacherID, SemesterID, SchoolYearID, Status, StartTime, EndTime, NOW(), NOW());
  END IF;
END
$$

--
-- Create procedure `Proc_GetTeacher`
--
CREATE PROCEDURE Proc_GetTeacher (IN ID char(36))
SQL SECURITY INVOKER
BEGIN
  SELECT
    t.TeacherID,
    t.FullName
  FROM teacher t
    LEFT JOIN subject s
      ON t.SubjectID = s.SubjectID
    LEFT JOIN module m
      ON s.SubjectID = m.SubjectID
    LEFT JOIN moduleclass m1
      ON m.ModuleID = m1.ModuleID
  WHERE m1.ModuleClassID = ID;
END
$$

