--
-- Create procedure `Proc_Getusers`
--
CREATE PROCEDURE Proc_Getusers ()
SQL SECURITY INVOKER
BEGIN
  SELECT
    u.UserID,
    u.UserName,
    u.PassWord,
    u.PermissionID,
    u.PhoneNumber,
    u.FullName,
    u.Email,
