DELIMITER $$

--
-- Create procedure `Proc_Updateuser`
--
CREATE PROCEDURE Proc_Updateuser (IN UserID char(36), IN UserName varchar(255), IN PassWord varchar(255), IN PermissionID char(36), IN FullName varchar(255), IN Email varchar(50), IN PhoneNumber varchar(255))
SQL SECURITY INVOKER
BEGIN
  UPDATE user u
  SET u.UserName = UserName,
      u.PassWord = PassWord,
      u.FullName = FullName,
      u.PhoneNumber = PhoneNumber,
      u.Email = Email,
      u.PermissionID = PermissionID,
      u.CreatedDate = NOW(),
      u.ModifiedDate = NOW()
  WHERE u.UserID = UserID;
END
$$

--
-- Create procedure `Proc_Updatesubject`
--
CREATE PROCEDURE Proc_Updatesubject (IN SubjectID char(36), IN SubjectName varchar(255))
SQL SECURITY INVOKER
BEGIN
  UPDATE subject s
  SET s.SubjectName = SubjectName,
      s.CreatedDate = NOW(),
      s.ModifiedDate = NOW()
  WHERE s.SubjectID = SubjectID;
END
$$

--
-- Create procedure `Proc_Updatemodule`
--
CREATE PROCEDURE Proc_Updatemodule (IN ModuleID char(36), IN ModuleCode varchar(20), IN ModuleName varchar(255), IN NumberOfModule float, IN Theory float, IN Practice float, IN BigExercise float, IN SubjectID char(36))
SQL SECURITY INVOKER
BEGIN
  UPDATE module m
  SET m.ModuleCode = ModuleCode,
      m.ModuleName = ModuleName,
      m.NumberOfModule = NumberOfModule,
      m.Theory = Theory,
      m.Practice = Practice,
      m.BigExercise = BigExercise,
      m.SubjectID = SubjectID,
      m.CreatedDate = NOW(),
      m.ModifiedDate = NOW()
  WHERE m.ModuleID = ModuleID;

END
$$

--
-- Create procedure `Proc_Insertuser`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Insertuser (IN UserName varchar(255), IN PassWord varchar(255), IN PermissionID char(36), IN FullName varchar(255), IN Email varchar(50), IN PhoneNumber varchar(255))
BEGIN
  INSERT INTO user (UserID, UserName, PassWord, PermissionID, FullName, PhoneNumber, Email, CreatedDate, ModifiedDate)
    VALUES (UUID(), UserName, PassWord, PermissionID, FullName, PhoneNumber, Email, NOW(), NOW());

END
$$

