--
CREATE PROCEDURE Proc_Insertsubject (IN SubjectName varchar(255))
SQL SECURITY INVOKER
BEGIN
  INSERT INTO subject (SubjectID, SubjectName, CreatedDate, ModifiedDate)
    VALUES (UUID(), SubjectName, NOW(), NOW());

END
$$

--
-- Create procedure `Proc_Insertmodule`
--
CREATE PROCEDURE Proc_Insertmodule (IN ModuleCode varchar(20), IN ModuleName varchar(255), IN NumberOfModule float, IN Theory float, IN Practice float, IN BigExercise float, IN SubjectID char(36))
SQL SECURITY INVOKER
BEGIN
  INSERT INTO module (ModuleID, ModuleCode, ModuleName, NumberOfModule, Theory, Practice, BigExercise, SubjectID, CreatedDate, ModifiedDate)
    VALUES (UUID(), ModuleCode, ModuleName, NumberOfModule, Theory, Practice, BigExercise, SubjectID, NOW(), NOW());

END
$$

