SQL SECURITY INVOKER
BEGIN
  SELECT
    *
  FROM subject s
  WHERE s.SubjectID = subjectId;
END
$$

--
-- Create procedure `Proc_Getmodules`
--
CREATE PROCEDURE Proc_Getmodules ()
SQL SECURITY INVOKER
BEGIN
  SELECT
    m.ModuleID,
    m.ModuleCode,
    m.ModuleName,
    m.NumberOfModule,
    m.Theory,
    m.Practice,
    m.BigExercise,
    m.SubjectID,
    m.CreatedDate,
    m.ModifiedDate,
    s.SubjectName
  FROM module m
    LEFT JOIN subject s
      ON m.SubjectID = s.SubjectID
  ORDER BY m.CreatedDate DESC;
END
$$

--
-- Create procedure `Proc_GetmoduleById`
--
CREATE PROCEDURE Proc_GetmoduleById (IN moduleId char(36))
SQL SECURITY INVOKER
BEGIN
  SELECT
    m.ModuleID,
    m.ModuleCode,
    m.ModuleName,
    m.NumberOfModule,
    m.Theory,
    m.Practice,
    m.BigExercise,
    m.SubjectID,
    m.CreatedDate,
    m.ModifiedDate,
    s.SubjectName
  FROM module m
    LEFT JOIN subject s
      ON m.SubjectID = s.SubjectID
  WHERE m.ModuleID = moduleId
  ORDER BY m.CreatedDate OR m.ModifiedDate DESC;
END
$$

--
-- Create procedure `Proc_Deleteuser`
--
CREATE PROCEDURE Proc_Deleteuser (IN UserID char(36))
SQL SECURITY INVOKER
